class Solution2:
    def lengthOfLongestSubstring(self, s: str) -> int:
        """`Time Limit Exceeded`が発生して、答えを探してきて見付けたやつ"""
        seen = {}
        length = 0
        output = 0
        for r in range(len(s)):
            """
            If s[r] not in seen, we can keep increasing the window size by moving right pointer
            There are two cases if s[r] in seen:
            case1: s[r] is inside the current window, we need to change the window by moving left pointer to seen[s[r]] + 1.
            case2: s[r] is not inside the current window, we can keep increase the window

            s[r] が表示されない場合は、右ポインタを移動してウィンドウ サイズを拡大し続けることができます。
            s[r] が表示される場合は 2 つのケースがあります。
            case1: s[r] は現在のウィンドウ内にあります。左ポインタを seen[s[r]] + 1 に移動してウィンドウを変更する必要があります。
            case2: s[r] は現在のウィンドウ内にないので、ウィンドウを増やし続けることができます
            """
            if s[r] not in seen:
                output = max(output, r - length + 1)
            else:
                if seen[s[r]] < length:
                    output = max(output, r - length + 1)
                else:
                    length = seen[s[r]] + 1
            seen[s[r]] = r
        return output

class Solution3:
    """ もうちょっとシンプルそうな答え
    :refer: https://leetcode.com/problems/longest-substring-without-repeating-characters/solutions/3649636/3-method-s-c-java-python-beginner-friendly/
    """
    def lengthOfLongestSubstring(self, s: str) -> int:
        n = len(s)
        maxLength = 0
        charSet = set()
        left = 0
        
        for right in range(n):
            if s[right] not in charSet:
                charSet.add(s[right])
                maxLength = max(maxLength, right - left + 1)
            else:
                while s[right] in charSet:
                    charSet.remove(s[left])
                    left += 1
                charSet.add(s[right])
        
        return maxLength


